import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})

export class AppComponent {
  title = 'ricki';
}
<div class="container">

  <nav>
    <a class="btn btn-primary" routerLink="/principal"

       routerLinkActive="active">Principal</a>

    <a class="btn btn-primary" routerLink="/personajes"

       routerLinkActive="active">Personajes</a>
  </nav>

  <router-outlet></router-outlet>

</div>
